// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Inicio from './components/Inicio';
import SobreNosotros from './components/SobreNosotros';
import Productos from './components/Productos'; // <-- NUEVO IMPORT AQUÍ
// import Ubicacion from './components/Ubicacion'; // Comentado por ahora
// import RealizarPedido from './components/RealizarPedido'; // Comentado por ahora
import './App.css';

function App() {
  return (
    <Router> 
      <div className="app-container">
        <header>
          <div className="logo">Kayak Snack</div>
          <nav>
            <ul>
              <li><Link to="/">Inicio</Link></li>
              <li><Link to="/sobre-nosotros">Sobre Nosotros</Link></li> 
              <li><Link to="/productos">Productos</Link></li> {/* <-- RUTA AGREGADA AQUÍ */}
              <li><Link to="/ubicacion">Ubicación</Link></li> 
              <li><Link to="/realizar-pedido">Realizar Pedido</Link></li> 
            </ul>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Inicio />} />
            <Route path="/sobre-nosotros" element={<SobreNosotros />} />
            <Route path="/productos" element={<Productos />} /> {/* <-- RUTA AGREGADA AQUÍ */}
            {/* Las rutas futuras para Ubicación y Realizar Pedido las dejé con placeholder por ahora */}
            <Route path="/ubicacion" element={<div><h1>Nuestra Ubicación</h1><p>Próximamente...</p></div>} />
            <Route path="/realizar-pedido" element={<div><h1>Realizar Pedido</h1><p>Próximamente...</p></div>} />
          </Routes>
        </main>
        <footer>
          <p>© 2025 Kayak Snack. Todos los derechos reservados.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
